PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "migrations" ("id" integer primary key autoincrement not null, "migration" varchar not null, "batch" integer not null);
CREATE TABLE IF NOT EXISTS "users" ("id" integer primary key autoincrement not null, "name" varchar not null, "email" varchar not null, "email_verified_at" datetime, "password" varchar not null, "role" varchar check ("role" in ('admin', 'super_admin')) not null default 'admin', "remember_token" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "password_reset_tokens" ("email" varchar not null, "token" varchar not null, "created_at" datetime, primary key ("email"));
CREATE TABLE IF NOT EXISTS "sessions" ("id" varchar not null, "user_id" integer, "ip_address" varchar, "user_agent" text, "payload" text not null, "last_activity" integer not null, primary key ("id"));
CREATE TABLE IF NOT EXISTS "cache" ("key" varchar not null, "value" text not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "cache_locks" ("key" varchar not null, "owner" varchar not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "jobs" ("id" integer primary key autoincrement not null, "queue" varchar not null, "payload" text not null, "attempts" integer not null, "reserved_at" integer, "available_at" integer not null, "created_at" integer not null);
CREATE TABLE IF NOT EXISTS "job_batches" ("id" varchar not null, "name" varchar not null, "total_jobs" integer not null, "pending_jobs" integer not null, "failed_jobs" integer not null, "failed_job_ids" text not null, "options" text, "cancelled_at" integer, "created_at" integer not null, "finished_at" integer, primary key ("id"));
CREATE TABLE IF NOT EXISTS "failed_jobs" ("id" integer primary key autoincrement not null, "uuid" varchar not null, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "personal_access_tokens" ("id" integer primary key autoincrement not null, "tokenable_type" varchar not null, "tokenable_id" integer not null, "name" varchar not null, "token" varchar not null, "abilities" text, "last_used_at" datetime, "expires_at" datetime, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "pengaduans" ("id" integer primary key autoincrement not null, "nama_pengadu" varchar not null, "email" varchar not null, "telepon" varchar, "subjek" varchar not null, "isi_pengaduan" text not null, "status" varchar check ("status" in ('pending', 'proses', 'selesai')) not null default 'pending', "tanggapan" text, "attachment" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "info_kantors" ("id" integer primary key autoincrement not null, "judul" varchar not null, "konten" text not null, "kategori" varchar not null, "is_active" tinyint(1) not null default '1', "icon" varchar, "urutan" integer not null default '0', "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "web_portals" ("id" integer primary key autoincrement not null, "nama_portal" varchar not null, "deskripsi" text not null, "url_portal" varchar not null, "kategori" varchar not null, "icon" varchar, "is_active" tinyint(1) not null default '1', "urutan" integer not null default '0', "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "portal_papua_tengahs" ("id" integer primary key autoincrement not null, "judul" varchar not null, "slug" varchar not null, "konten" text not null, "penulis" varchar not null, "kategori" varchar check ("kategori" in ('berita', 'pengumuman', 'kegiatan', 'regulasi', 'layanan')) not null, "thumbnail" varchar, "is_featured" tinyint(1) not null default '0', "is_published" tinyint(1) not null default '1', "published_at" datetime, "tags" varchar, "meta_description" varchar, "views" integer not null default '0', "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "wbs" ("id" integer primary key autoincrement not null, "nama_pelapor" varchar not null, "email" varchar not null, "no_telepon" varchar, "subjek" varchar not null, "deskripsi" text not null, "tanggal_kejadian" date, "lokasi_kejadian" text, "pihak_terlibat" text, "kronologi" text, "bukti_file" varchar, "status" varchar check ("status" in ('pending', 'in_progress', 'resolved', 'rejected')) not null default 'pending', "response" text, "responded_at" datetime, "admin_note" text, "attachment" varchar, "is_anonymous" tinyint(1) not null default '0', "created_at" datetime, "updated_at" datetime);
DELETE FROM sqlite_sequence;
CREATE INDEX "users_role_index" on "users" ("role");
CREATE UNIQUE INDEX "users_email_unique" on "users" ("email");
CREATE INDEX "sessions_user_id_index" on "sessions" ("user_id");
CREATE INDEX "sessions_last_activity_index" on "sessions" ("last_activity");
CREATE INDEX "jobs_queue_index" on "jobs" ("queue");
CREATE UNIQUE INDEX "failed_jobs_uuid_unique" on "failed_jobs" ("uuid");
CREATE INDEX "personal_access_tokens_tokenable_type_tokenable_id_index" on "personal_access_tokens" ("tokenable_type", "tokenable_id");
CREATE UNIQUE INDEX "personal_access_tokens_token_unique" on "personal_access_tokens" ("token");
CREATE INDEX "pengaduans_status_index" on "pengaduans" ("status");
CREATE INDEX "pengaduans_email_index" on "pengaduans" ("email");
CREATE INDEX "info_kantors_kategori_is_active_index" on "info_kantors" ("kategori", "is_active");
CREATE INDEX "info_kantors_urutan_index" on "info_kantors" ("urutan");
CREATE INDEX "web_portals_kategori_is_active_index" on "web_portals" ("kategori", "is_active");
CREATE INDEX "web_portals_url_portal_index" on "web_portals" ("url_portal");
CREATE INDEX "web_portals_urutan_index" on "web_portals" ("urutan");
CREATE INDEX "portal_papua_tengahs_kategori_is_published_index" on "portal_papua_tengahs" ("kategori", "is_published");
CREATE INDEX "portal_papua_tengahs_is_featured_is_published_index" on "portal_papua_tengahs" ("is_featured", "is_published");
CREATE INDEX "portal_papua_tengahs_published_at_index" on "portal_papua_tengahs" ("published_at");
CREATE UNIQUE INDEX "portal_papua_tengahs_slug_unique" on "portal_papua_tengahs" ("slug");
CREATE INDEX "wbs_status_index" on "wbs" ("status");
CREATE INDEX "wbs_email_index" on "wbs" ("email");
CREATE INDEX "wbs_created_at_index" on "wbs" ("created_at");
COMMIT;
