INSERT INTO portal_papua_tengahs VALUES(1,'Inspektorat Papua Tengah Luncurkan Program Pengawasan Terintegrasi','inspektorat-papua-tengah-luncurkan-program-pengawasan-terintegrasi','Inspektorat Provinsi Papua Tengah meluncurkan program pengawasan terintegrasi untuk meningkatkan efektivitas pengawasan internal pemerintah daerah. Program ini bertujuan untuk memastikan akuntabilitas dan transparansi dalam pengelolaan keuangan dan pelayanan publik.','Humas Inspektorat Papua Tengah','berita',NULL,1,1,'2025-07-01 18:23:21','"pengawasan, transparansi, akuntabilitas"','Program pengawasan terintegrasi Inspektorat Papua Tengah untuk meningkatkan akuntabilitas pemerintahan.',177,'2025-07-01 18:23:21','2025-07-04 11:42:58');
INSERT INTO portal_papua_tengahs VALUES(2,'Pengumuman Rekrutmen Auditor Internal Papua Tengah','pengumuman-rekrutmen-auditor-internal-papua-tengah','Inspektorat Provinsi Papua Tengah membuka kesempatan bagi putra-putri terbaik Papua Tengah untuk bergabung sebagai auditor internal. Pendaftaran dibuka mulai tanggal 1 hingga 30 Juli 2025.','Bagian Kepegawaian','pengumuman',NULL,0,1,'2025-06-28 18:23:21','"rekrutmen, auditor, lowongan kerja"','Pengumuman rekrutmen auditor internal Inspektorat Papua Tengah 2025.',105,'2025-06-28 18:23:21','2025-07-04 11:21:21');
INSERT INTO portal_papua_tengahs VALUES(3,'Kegiatan Sosialisasi Sistem Pengendalian Intern Pemerintah (SPIP)','kegiatan-sosialisasi-sistem-pengendalian-intern-pemerintah-spip','Inspektorat Papua Tengah menyelenggarakan kegiatan sosialisasi SPIP kepada seluruh OPD di lingkungan Pemerintah Provinsi Papua Tengah. Kegiatan ini bertujuan untuk meningkatkan pemahaman tentang implementasi SPIP.','Tim SPIP Inspektorat','kegiatan',NULL,0,1,'2025-06-26 18:23:21','"SPIP, sosialisasi, pengendalian intern"','Sosialisasi SPIP untuk OPD Papua Tengah oleh Inspektorat.',69,'2025-06-26 18:23:21','2025-07-04 11:17:36');
INSERT INTO portal_papua_tengahs VALUES(4,'Peraturan Gubernur Papua Tengah Nomor 25 Tahun 2025 tentang Whistleblower System','peraturan-gubernur-papua-tengah-nomor-25-tahun-2025-tentang-whistleblower-system','Gubernur Papua Tengah menerbitkan Peraturan Gubernur tentang Whistleblower System sebagai upaya pencegahan dan pemberantasan korupsi di lingkungan Pemerintah Provinsi Papua Tengah.','Bagian Hukum','regulasi',NULL,1,1,'2025-06-23 18:23:21','"peraturan, whistleblower, anti korupsi"','Peraturan Gubernur Papua Tengah tentang implementasi Whistleblower System.',234,'2025-06-23 18:23:21','2025-07-03 18:23:21');
INSERT INTO portal_papua_tengahs VALUES(5,'Layanan Konsultasi Pengawasan Online Papua Tengah','layanan-konsultasi-pengawasan-online-papua-tengah','Inspektorat Papua Tengah menyediakan layanan konsultasi pengawasan secara online untuk memudahkan OPD dalam berkonsultasi terkait pelaksanaan pengawasan dan audit internal.','Bagian Layanan Pengawasan','layanan',NULL,0,1,'2025-06-21 18:23:21','"layanan online, konsultasi, pengawasan"','Layanan konsultasi pengawasan online Inspektorat Papua Tengah.',45,'2025-06-21 18:23:21','2025-07-03 18:23:21');
INSERT INTO portal_papua_tengahs VALUES(6,'Rapat Koordinasi Pencegahan Korupsi di Papua Tengah','rapat-koordinasi-pencegahan-korupsi-di-papua-tengah','Inspektorat Papua Tengah mengadakan rapat koordinasi dengan berbagai instansi terkait untuk membahas strategi pencegahan korupsi di Papua Tengah. Rapat dihadiri oleh perwakilan dari KPK, Kejaksaan, dan Kepolisian.','Sekretariat Inspektorat','kegiatan',NULL,0,1,'2025-06-18 18:23:21','"koordinasi, pencegahan korupsi, kerjasama"','Rapat koordinasi pencegahan korupsi Papua Tengah dengan instansi terkait.',78,'2025-06-18 18:23:21','2025-07-03 18:23:21');
INSERT INTO wbs VALUES(1,'Andi Pratama','andi.pratama@email.com','081234567890','Dugaan Penyalahgunaan Wewenang','Melaporkan adanya dugaan penyalahgunaan wewenang dalam proses tender proyek infrastruktur di Kabupaten Papua Tengah.','2025-06-15 00:00:00','Kantor Dinas Pekerjaan Umum Papua Tengah','Kepala Dinas dan Staff Pengadaan','Pada tanggal 15 Juni 2025, terdapat indikasi manipulasi proses tender dimana kriteria teknis diubah secara mendadak untuk menguntungkan pihak tertentu.',NULL,'pending',NULL,NULL,NULL,NULL,0,'2025-06-28 18:23:21','2025-07-03 18:23:21');
INSERT INTO wbs VALUES(2,'Siti Nurhaliza','siti.nurhaliza@email.com','081234567891','Praktik Korupsi Dalam Pengadaan Barang','Terdapat indikasi praktik korupsi dalam pengadaan barang dan jasa di instansi pemerintah daerah Papua Tengah.','2025-06-01 00:00:00','Kantor Badan Pengadaan Barang dan Jasa Papua Tengah','Kepala Badan dan Vendor Terpilih','Proses pengadaan dilakukan dengan tidak transparan dan terdapat mark-up harga yang signifikan.',NULL,'in_progress','Laporan sedang dalam proses verifikasi dan penyelidikan.','2025-06-25 18:23:21',NULL,NULL,0,'2025-06-23 18:23:21','2025-07-03 18:23:21');
INSERT INTO wbs VALUES(3,'Budi Santoso','budi.santoso@email.com','081234567892','Pelanggaran Etika Pegawai','Melaporkan pelanggaran etika yang dilakukan oleh pegawai dalam pelayanan publik di Papua Tengah.','2025-05-20 00:00:00','Kantor Pelayanan Terpadu Satu Pintu Papua Tengah','Pegawai Loket Pelayanan','Pegawai melakukan diskriminasi pelayanan dan meminta imbalan untuk mempercepat proses perizinan.',NULL,'resolved','Laporan telah ditindaklanjuti dan pegawai yang bersangkutan telah diberikan sanksi sesuai peraturan.','2025-06-21 18:23:21',NULL,NULL,0,'2025-06-18 18:23:21','2025-07-03 18:23:21');
INSERT INTO wbs VALUES(4,'Anonymous','anonymous@wbs.com',NULL,'Dugaan Gratifikasi','Melaporkan dugaan gratifikasi yang diterima oleh pejabat dalam proses perizinan di Papua Tengah.','2025-06-28 00:00:00','Kantor Bupati Papua Tengah','Pejabat Struktural','Terdapat pemberian hadiah kepada pejabat untuk memperlancar proses perizinan perusahaan.',NULL,'pending',NULL,NULL,NULL,NULL,1,'2025-06-30 18:23:21','2025-07-03 18:23:21');
INSERT INTO wbs VALUES(5,'Maria Gonzales','maria.gonzales@email.com','081234567893','Penyimpangan Anggaran Daerah','Terdapat indikasi penyimpangan dalam penggunaan anggaran daerah Papua Tengah untuk program pembangunan.','2025-06-10 00:00:00','Kantor Dinas Pekerjaan Umum Papua Tengah','Kepala Dinas dan Kontraktor','Anggaran dialokasikan untuk proyek fiktif dan tidak sesuai dengan rencana pembangunan yang telah ditetapkan.',NULL,'in_progress','Tim investigasi sedang melakukan pemeriksaan terhadap laporan ini.','2025-06-28 18:23:21',NULL,NULL,0,'2025-06-26 18:23:21','2025-07-03 18:23:21');
INSERT INTO wbs VALUES(6,'Rudi Hermawan','rudi.hermawan@email.com','081234567894','Pungutan Liar','Melaporkan adanya pungutan liar dalam proses pengurusan dokumen di kantor pemerintahan Papua Tengah.','2025-05-15 00:00:00','Kantor Camat Papua Tengah','Petugas Administrasi','Petugas meminta biaya tambahan diluar tarif resmi untuk pengurusan surat keterangan.',NULL,'rejected','Laporan tidak dapat diverifikasi karena kurangnya bukti pendukung.','2025-06-18 18:23:21',NULL,NULL,0,'2025-06-13 18:23:21','2025-07-03 18:23:21');
